					doughnut,
					[~Sir, there's something we need\\nto bring to your attention.~],
					ralph,
					[~Can it wait?\\nI was just winding down.~],
					[~I've had a pretty rough day.~],
					doughnut,
					[~No, I don't believe it can.~],
					[~Cameras have picked up an intruder,\\nwhich we believe has somehow entered\\nfrom the cave outlet.~],
					ralph,
					[~So?  I mean, what the hell?\\nJust do the usual protocol...~],
					doughnut,
					[~No.. sir, you don't understand.\\nWe think it's HIM.~],
					ralph,
					[~Him...?~],
					doughnut,
					[~As in \"Frogatto\".\\nIt matches the profile you gave us.~],
					ralph,
					[~...\\nMother of god.~],
					[~How is that even possible?\\nHow did he get here?~],
					doughnut,
					[~Beats me.  More to the point, though,\\nwhat should we do?~],
					[~Should we try to negotiate with him?~],
					ralph,
					[~Are you kidding me?  With him?\\nGood god no...just kill it!~],
					[~Use any means necessary!~],
					[~That thing's not gonna negotiate.\\nIt's clearly out for BLOOD.~],
					[~I mean, holy hell, if it came this far...\\nON FOOT?  That's just nuts.~],
					[~There's only one thing that can\\ndrive a man like that:  Revenge.~],
					doughnut,
					[~Uh... I never said he walked...\\nListen, aren't we jumping to conclusions here?~],
					ralph,
					[~No, trust me on this,\\nI've seen this guy firsthand.~],
					[~Shoot first or you might not\\nget a second chance.~],
					[~That's an order.~],
					doughnut,
					doughnut.walk_to(1305),
					[~Fine.~],
					
					),
